import CategoryList from "./CategoryList";
import Navi from "./Navi";
import ProductList from "./ProductList";
import {Container,Row,Col} from "reactstrap";

function App() {
  return (
    <div >
      <Container>
      <Row>
      <Navi/>
      </Row>
      <Row>
        <Col xs="3">
        <ProductList/>
        </Col>
        <Col xs="9">
        <CategoryList/>
        </Col>


      </Row>
      </Container>

    </div>
  );
}

export default App;
